import React from "react";

function Portfolio() {
  return (
    <>
      <h3>Portfolio <small className="text-muted">Projects</small></h3>
      <hr />
      <h3>Card of Project</h3>
      <p>
      [image of project]
      </p>
      <h3>Link to project </h3>
    </>
  );
}

export default Portfolio;
